There are several ways to create new dictionaries: Dictionary literals: Each key and value is separated with a colon, while the key:value pairs are separated by commas. Then the comma-separated pairs are placed within a pair of curly braces: # dictionary literal for looking up state capitals:
state_capitals = { "Alabama": "Montgomery", "Alaska": "Juneau", "Arizona": "Phoenix", "Arkansas": "Little Rock", "California": "Sacramento", "Colorado": "Denver", # etc...
} Create an empty dictionary, then append elements within a loop (this strategy is especially useful for building a dictionary from data stored in a file): student_ids = {}
name = ""
while name != ".": name = input("Student name? (Enter . to finish) ") if name != ".": id = input("Student id? ") student_ids[name] = id Create a dictionary using the dict() function. This constructor allows you to pass the information in a variety of forms. # Create a copy of an existing dictionary:
copy_state_capitals = dict(state_capitals) # Create a dictionary from a list of tuples (each tuple is a key/value pair)
numbers_to_words = dict([(1, 'one'), (2, 'two'), (3, 'three')]) # Create a list of tuples by zipping together two separate lists,
# the first is the list of keys, the second is the matched list of values.
# Then create a dictionary from that zipped list of tuples
numbers_to_words = dict(zip([1, 2, 3], ['one', 'two', 'three'])) The number of items (i.e., the number of key/value pairs), is given by len(dictionary_name).

