def first_digit_even(number: int) -> bool: # Keep dividing by 10 until the number is less than 10 while number >= 10: number = number // 10 # Now we have a one-digit number. See if that digit is even return number%2 == 0 The while-loop repeatedly divides by 10 using integer division (shifting the number to the right), until only one digit remains. That digit is the first digit of the original number. Then on the last line, the expression number%2==0 evaluates to True if that first digit is even, and False if that first digit is odd. The True or False value gets returned. Here's an example of a code snippet that uses the function: user_num = int(input("Enter an integer: "))
if first_digit_even(user_num): print(f"The first digit of {user_num} is even.")
